swaptrade_modal_desc_crosschain_valuedif:
Comisioanele integrate în diferența de valoare pentru acest swap în blockchain încrucișat sunt:
• Comision bridge blockchain încrucișat: {bridgePriceAndFee}
• Comision de rețea pe lanțul de destinație: {toChainPriceAndFee}
• Când tranzacționați o anumită cantitate de tokenuri, este afectată adâncimea de minare lichidități. Acest lucru, la rândul său, modifică disponibilitatea totală și prețul tokenurilor, ducând la schimbări semnificative de preț.

swaptrade_mid_dialog_desc_est_network_fe:
În tranzacțiile cross-chain, acest comision include comisioanele de rețea pentru lanțul tokenului de plată și bridge cross-chain.

Comisionul acestei tranzacții este afișat ca:
· {chain} comision de rețea chain: {value1}
· {bridge} comision de rețea bridge: {value2}

Comisioanele de rețea sunt plătite către mineri și nu sunt percepute de platforma noastră.

swaptrade_intro_dialog_desc_cross_value_:
Diferența de valoare pentru această tranzacție este afișată astfel:
· {chain} comision de rețea chain: {value1}
· {bridge} comision bridge: {value2}

Dacă diferența de valoare este mult mai mare în timp ce comisioanele listate mai sus sunt relativ mici, acest lucru apare deoarece valoarea de swap a afectat adâncimea fondului de lichiditate pentru perechea acestui token.

swaptrade_intro_tooltip_trade_including_:
În swap cross-chain, costul include plata comisioanelor de tranzacție pe lanț și o parte din comisioanele bridge cross-chain. Detalierea comisionului pentru această tranzacție:
• Comision de rețea: {fromChainPriceAndFee}
• Comision bridge cross-chain: {bridgePriceAndFee}
Comisionul de rețea acoperă costurile minerilor și nu este perceput de platforma noastră

